:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Catherine (Kate) and HADFIELD, Octavius
  JHADFIELD, Henry Samuel and TUCKEY, Elizabeth Rhodes
  JHADFIELD, Selwyn Tancred and HARPER, Rosamond Mary Templer
  05> HADFIELD, Selwyn Tancred m on 17.10.1937 to (1) HARPER, Rosamond Mary Templer
  b 31.01.1907 d 29.05.1973
  b 22.03.1909
  Rosamond, d/o Arthur Paul Harper (b. 1865, m. 1899, d. 1955, awarded the CBE in
  1948) and Marion Florence Campbell (b. 1870, d. 1938). Address: (Rosamond) 6700
  Trapper Way, Midland, Georgia 31820, USA.
  Selwyn was a man of many parts. An expert in heavy machinery, he was employed to
  demonstrate its use in the construction of a road through the Hutt Valley and
  through the Homer Tunnel to Milford Sound. Later he became a tobacco farmer in
  the Nelson district. He was also an accomplished amateur wrestler and a motor cycle racer. In later life
  he also raced motor-cars. He was a keen potter and a talented Maori carver, carving the lectern and stool
  for the Maori Church in Otaki. This lectern was later featured on a postage stamp issued on 23 April 1968,
  in which it was depicted supporting a Maori Bible.
  Rosamond's great grand-father was John Chitty Harper who was the first Bishop of Christchurch between 1856
  and 1889. Her father, Arthur Harper, was educated at Christ's College in New Zealand and Oxford University
  in England, and was called to the Bar at the Inner Temple in 1888. He was also called to the Bar in New
  Zealand and was awarded the CBE in 1948. He was one of the founders of the New Zealand Alpine Club and in
  later life he was president of the Forest and Bird Protection Society.
  In her early years, Rosamond was a mountain guide at the original Hermitage at Mount Cook. She also made
  the first all-woman ascent of Mount Sefton (10,369 ft) with two other woman climbers on 6 December 1934,
  Rosamond now lives with her daughter, Sue Sutcliff and is still very active, keeping busy with her garden
  and going for walks each day.
  01> HADFIELD, Michael Strachey m on 11.10.1965 to SILVER, Patricia Rose
  b 10.10.1938
  b 04.03.1943
  Michael b. at Karori, Wellington and m, at Auckland. Patricia b. at Dublin,
  Ireland. Address: PO Box 95-112, Swanson, Waitakere City.
  Michael was educated at Timaru Boys' High School then, after completing his
  Compulsory Military Training, he went to England for three years. His
  interest have included skiing and climbing.
  Patricia was educated in Ireland and England and was trained in hotel
  management when she came to New Zealand in 1964. She has since been involved in office management and
  personnel management and is currently in market research. Her interests include reading, music and
  general knowledge.
  01> HADFIELD, Julie Lee
  b 04.12.1972
  Julie b. at Auckland. Address: Email julie.hadfield@bankstrust.co.nz.
  Julie was educated at Waitakere College then attended Columbus College, Georgia on a
  Tennis Scholarship where she graduated with a Bachelor of Business Administration
  majoring in Finance. She is now back in New Zealand and is working for Bankers
  Trust NZ Ltd.
  02> HADFIELD, Dawn Gay (Sue) m on 19.11.1960 to SUTCLIFF, Paul Richard
  b 20.04.1940
  b 17.10.1941
  Susan b. at Nelson. Paul b. in USA. Address: 6700 Trapper Way, Midland, GA
  31820, USA. Email: sutcliffp@msn.com.
  Susan graduated from Timaru Girls' High School in 1955 and travelled the
  following year to England where she continued her education in London and
  Paris. After her marriage she and Paul lived in Paris for three years, at Fort
  Sill, Oklahoma for three years and in Georgia for the past 25 years. Susan was
  a manager for Tupperware Home Parties for eight years and is currently working for a local department
  store,
  When not working, Sue's hobbies are playing tennis, running and working on her 'creative memories'
  (cont...)
